def getRandomString(length):
    return ''.join(random.choices(string.ascii_uppercase + string.digits, k=length))

class mbtilesProvider():
    tilePath = ""
    tiles = []
    metadata = []
    def __init__(self, path):
        self.tilePath = path
        self.getTiles()
        self.getMetadata()
    def getTiles(self):
        conn = sqlite3.connect(self.tilePath)
        cursor = conn.execute("SELECT zoom_level, tile_column, tile_row, tile_data from tiles")
        for row in cursor:
            tile = {"zoom_level": row[0], "tile_column": row[1], "tile_row": row[2], "tile_data": row[3]}
            self.tiles.append(tile)
        conn.close()
    def getMetadata(self):
        conn = sqlite3.connect(self.tilePath)
        cursor = conn.execute("SELECT name, value from metadata")
        for row in cursor:
            meta = {"name": row[0], "value": row[1]}
            self.metadata.append(meta)
        conn.close()
    def executeSQL(self, query, key_name):
        conn = sqlite3.connect(self.tilePath)
        cursor = conn.execute(query)
        response = []
        for row in cursor:
            resp = {key_name: row[0]}
            response.append(resp)
        conn.close()
        return response

