    def __init__(self, path, format, table_name, epsg, isVector):
        self.createGPKG(path, table_name)
        self.insertSpatialRefSys(path)
        self.TilePath = path
        self.Format = format
        self.Table_Name = table_name
        self.Projection = epsg
        self.IsVector = isVector

    def updateGPKGContent(self, description, gpkg_bounds, projection):
        conn = sqlite3.connect(self.TilePath)
        type = "tiles"
        if (self.Format == "pbf" or self.Format == "PBF"):
            type = "vector-tiles"

        conn.execute(f"INSERT OR IGNORE INTO gpkg_contents (table_name, data_type, identifier, description, last_change, min_x, min_y, max_x, max_y, srs_id) VALUES(?,?,?,?,?,?,?,?,?,?)", (self.Table_Name, type, getRandomString(10), description, datetime.datetime.now(), gpkg_bounds['min_x'], gpkg_bounds['min_y'], gpkg_bounds['max_x'], gpkg_bounds['max_y'], projection ))
        conn.commit()
        conn.close()
        self.insertGPKGExtensios()
        self.insertGPKGTileMatrixTable(gpkg_bounds)
        self.insertGPKGExtTileMatrix(gpkg_bounds, projection)
        self.insertGPKGExtTileMatrixSet(projection)
        self.insertGPKGContentTypes()
        self.insertGPKGSemanticAnnotations()

