    def insertGPKGVTLayersAndFields(self, styleJSON):
        conn = sqlite3.connect(self.TilePath)
        json_object = json.loads(styleJSON)
        vector_layers = json_object["vector_layers"]
        tilestats_layers = json_object["tilestats"]["layers"]
        for layer in vector_layers:
            name = layer["id"]
            description = layer["description"]
            minzoom = layer["minzoom"]
            maxzoom = layer["maxzoom"]
            for tile_stat in tilestats_layers:
                geometry = "unknown"
                if (tile_stat["layer"] == name):
                    geometry = tile_stat["geometry"]
                    geometry_dimension = 'null'
                    if (geometry.lower() == "point" or geometry.lower() == "multipoint"):
                        geometry_dimension = "0"
                    elif (geometry.lower() == "linestring" or geometry.lower() == "multilinestring"):
                        geometry_dimension = "1"
                    elif (geometry.lower() == "polygon" or geometry.lower() == "multipolygon"):
                        geometry_dimension = "2"
                    conn.execute(f"INSERT OR IGNORE INTO \"gpkgext_vt_layers\" (\"table_name\",\"name\",\"description\",\"minzoom\",\"maxzoom\",\"attributes_table_name\",\"geometry_dimension\") VALUES ('{self.Table_Name}','{name}','{description}','{minzoom}','{maxzoom}',NULL,'{geometry_dimension}');")
                    conn.commit()
                    layer_id = self.executeSQL(f"SELECT id FROM gpkgext_vt_layers WHERE table_name = '{self.Table_Name}' AND name = '{name}' AND maxzoom = '{maxzoom}'",
                        "layer_id")[0]["layer_id"]
                    for attribute in tile_stat["attributes"]:
                        attr = attribute["attribute"]
                        type = attribute["type"]
                        conn.execute(f"INSERT OR IGNORE INTO \"gpkgext_vt_fields\" (\"layer_id\",\"name\",\"type\") VALUES ({layer_id},'{attr}','{type.capitalize()}');")
                        conn.commit()

        conn.commit()
        conn.close()

    def insertGPKGStylesFonts(self, resourceDir):
        conn = sqlite3.connect(self.TilePath)
        for folder in os.listdir(resourceDir):
            if (folder == "styles"):
                fontDirs = os.listdir(os.path.join(resourceDir,folder))
                for font in fontDirs:
                    if (os.path.isdir(os.path.join(resourceDir, folder, font))):
                        files = os.listdir(os.path.join(resourceDir, folder, font))
                        for item in files:
                            if ("style.json" in item):
                                in_file = open(os.path.join(resourceDir,folder,font,item), "rb")
                                styleJSON = in_file.read()
                                in_file.close()
                                conn.execute(
                                    f"INSERT OR IGNORE INTO \"gpkgext_styles\" (\"style\",\"description\",\"uri\") VALUES ('{font}','{font}','file:///{os.path.join(resourceDir, folder, font, item)}');")
                                conn.commit()
                                style_id = self.executeSQL(
                                    f"SELECT id FROM \"gpkgext_styles\" WHERE \"style\" = '{font}' AND \"uri\" = 'file:///{os.path.join(resourceDir, folder, font, item)}'",
                                    "style_id")[0]["style_id"]
                                conn.execute(
                                    "INSERT OR IGNORE INTO \"gpkgext_stylesheets\" (\"style_id\",\"format\",\"stylesheet\") VALUES (?,?,?);",
                                    (style_id, "mbstyle", styleJSON))
                                conn.commit()
                            elif ("sprite.png" in item):
                                in_file = open(os.path.join(resourceDir,folder,font,item), "rb")
                                spriteBytes = in_file.read()
                                in_file.close()
                                conn.execute(
                                    "INSERT OR IGNORE INTO \"gpkgext_symbol_content\" (\"format\",\"content\",\"uri\") VALUES (?,?,?);",
                                    ("image/png", spriteBytes, f"file:///{os.path.join(resourceDir,folder,font,item)}"))
                                conn.commit()
                            elif ("sprite@2x.png" in item):
                                in_file = open(os.path.join(resourceDir,folder,font,item), "rb")
                                spriteBytes = in_file.read()
                                in_file.close()
                                conn.execute(
                                    "INSERT OR IGNORE INTO \"gpkgext_symbol_content\" (\"format\",\"content\",\"uri\") VALUES (?,?,?);",
                                    ("image/png", spriteBytes, f"file:///{os.path.join(resourceDir,folder,font,item)}"))
                                conn.commit()
            elif (folder == "fonts"):
                fontDirs = os.listdir(os.path.join(resourceDir, folder))
                for fonts in fontDirs:
                    if(os.path.isdir(os.path.join(resourceDir,folder,fonts))):
                        glyphZipFile = os.path.join(resourceDir,folder, fonts, f"{fonts}.ttf.zip")
                        fontZipFile = os.path.join(resourceDir,folder, fonts, f"{fonts}.pbf.zip")
                        if(os.path.exists(glyphZipFile)):
                            os.remove(glyphZipFile)
                        if (os.path.exists(fontZipFile)):
                            os.remove(fontZipFile)
                        glyphFile = os.listdir(os.path.join(resourceDir,folder, fonts))  # .ttf
                        fontFile = os.listdir(os.path.join(resourceDir,folder, fonts))  # .pbf

                        with ZipFile(glyphZipFile, 'w') as zip_object:
                            for files in glyphFile:
                                if (".ttf" in files):
                                    zip_object.write(os.path.join(resourceDir,folder,fonts,files))

                        with ZipFile(fontZipFile, 'w') as zip_object:
                            for files in fontFile:
                                if (".pbf" in files):
                                    zip_object.write(os.path.join(resourceDir,folder,fonts,files))

                        in_file = open(glyphZipFile, "rb")
                        fontBLOB = in_file.read()
                        in_file.close()

                        in_file = open(fontZipFile, "rb")
                        glyphBLOB = in_file.read()
                        in_file.close()

                        if (os.path.exists(glyphZipFile)):
                            os.remove(glyphZipFile)
                        if (os.path.exists(fontZipFile)):
                            os.remove(fontZipFile)
                        conn.execute("INSERT OR IGNORE INTO \"gpkgext_fonts\" (name, font, glyphs) VALUES (?,?,?);",(fonts, fontBLOB, glyphBLOB))
                        conn.commit()
        conn.commit()
        conn.close()

