def main():
    parser = OptionParser()
    parser.add_option("-i", "--input", default="", dest="input", help="Input path of mbtiles")
    parser.add_option("-o", "--output", default="", dest="output", help="Output path of gpkg")
    parser.add_option("-p", "--proj", default=3857, dest="projection", help="ie. 3395/3857/4326")
    parser.add_option("-r", "--resource", default="./RBT_Resources", dest="resource", help="Directory path of resources folder")
    parser.add_option("-t", "--table", default="tiles", dest="table", help="Table name in geopackage")

    (options, args) = parser.parse_args()

    if (os.path.exists(options.input)):
        start = time.time()
        mbtiles = mbtilesProvider(options.input)

        # Getting Mbtiles Bounds

        format = mbtiles.executeSQL("SELECT value FROM metadata WHERE name = 'format'", "format")[0]["format"]
        min_z = mbtiles.executeSQL("SELECT MIN(zoom_level) FROM tiles", "min_z")[0]["min_z"]
        max_z = mbtiles.executeSQL("SELECT MAX(zoom_level) FROM tiles", "max_z")[0]["max_z"]
        min_x = mbtiles.executeSQL(f"SELECT Min(tile_column) FROM tiles where zoom_level = '{max_z}'", "min_x")[0][
            "min_x"]
        max_x = mbtiles.executeSQL(f"SELECT Max(tile_column) FROM tiles where zoom_level = '{max_z}'", "max_x")[0][
            "max_x"]
        min_y = mbtiles.executeSQL(
            f"SELECT Min(tile_row) FROM tiles where zoom_level = '{max_z}' and tile_column = '{min_x}'", "min_y")[
            0]["min_y"]
        max_y = mbtiles.executeSQL(
            f"SELECT Max(tile_row) FROM tiles where zoom_level = '{max_z}' and tile_column = '{max_x}'", "max_y")[
            0]["max_y"]

        min_long = min_x / (1 << max_z) * 360.0 - 180
        max_long = max_x / (1 << max_z) * 360.0 - 180
        n1 = math.pi - 2.0 * math.pi * min_y / (1 << max_z)
        n2 = math.pi - 2.0 * math.pi * max_y / (1 << max_z)
        min_lat = 180.0 / math.pi * math.atan((0.5 * (math.exp(n1) - math.exp(-n1))))
        max_lat = 180.0 / math.pi * math.atan(0.5 * (math.exp(n2) - math.exp(-n2)))
        max_lat = max_lat * -1
        min_lat = min_lat * -1
        center_long = (max_long + min_long) / 2
        center_lat = (min_lat + max_lat) / 2
        gpkg_bounds = getGPKGBounds(min_z, max_z, min_long, max_long,
                                    min_lat, max_lat, center_lat, center_long, options.projection)
        description = ""
        for item in mbtiles.metadata:
            if (item['name'] == "description"):
                description = item['value']
        if (format.lower() == "pbf"):
            gpkg = gpkgProvider(options.output, format.lower(), options.table, options.projection, True)
            gpkg.insertGPKGTiles(mbtiles.tiles)
            gpkg.updateGPKGContent(description, gpkg_bounds, options.projection)
            gpkg.insertGPKGVTLayersAndFields(
                mbtiles.executeSQL(f"SELECT value FROM metadata where name = 'json'", "tile_json")[0]["tile_json"])
            if (os.path.exists(options.resource)):
                gpkg.insertGPKGStylesFonts(options.resource)
            gpkg.insertGPKGSAReference()
            gpkg.insertGPKGSymbols()
        else:
            gpkg = gpkgProvider(options.output, format.lower(), options.table, options.projection, False)
            gpkg.insertGPKGTiles(mbtiles.tiles)
            gpkg.updateGPKGContent(description, gpkg_bounds, options.projection)
            gpkg.insertGPKGSAReference()
        end = time.time()
        print(f"Time taken to run the code was {end - start} seconds")
    else:
        print("Unable to execute, mbtile doesnot esist")

def getGPKGBounds(min_z, max_z, min_x, max_x, min_y, max_y, center_x, center_y, projection):
    if(projection == "3395"):
        transformer = Transformer.from_crs("EPSG:4326", "EPSG:3395", always_xy=True)
        min_crs = transformer.transform(min_x, min_y)
        max_crs = transformer.transform(max_x, max_y)
        center_crs = transformer.transform(center_x, center_y)
        return {'min_z': min_z, 'max_z': max_z, 'min_x': min_crs[0], 'min_y': min_crs[1],
                'max_x': max_crs[0], 'max_y': max_crs[1], 'center_x': center_crs[0], 'center_y': center_crs[1]}
    elif(projection == "3857"):
        transformer = Transformer.from_crs("EPSG:4326", "EPSG:3857", always_xy=True)
        min_crs = transformer.transform(min_x, min_y)
        max_crs = transformer.transform(max_x, max_y)
        center_crs = transformer.transform(center_x, center_y)
        return {'min_z': min_z, 'max_z': max_z, 'min_x': min_crs[0], 'min_y': min_crs[1],
                'max_x': max_crs[0], 'max_y': max_crs[1], 'center_x': center_crs[0], 'center_y': center_crs[1]}
    elif(projection == "4326"):
        transformer = Transformer.from_crs("EPSG:4326", "EPSG:4326", always_xy=True)
        min_crs = transformer.transform(min_x, min_y)
        max_crs = transformer.transform(max_x, max_y)
        center_crs = transformer.transform(center_x, center_y)
        return {'min_z': min_z, 'max_z': max_z, 'min_x': min_crs[0], 'min_y': min_crs[1],
                'max_x': max_crs[0], 'max_y': max_crs[1], 'center_x': center_crs[0], 'center_y': center_crs[1]}
    else:
        return {'min_z': min_z, 'max_z': max_z, 'min_x': 0, 'min_y': 0,
                'max_x': 0, 'max_y': 0, 'center_x': 0, 'center_y': 0}

if __name__ == '__main__':
    main()
